syntax = "proto3";
option csharp_namespace = "Common.Protobuf";

option java_package = "catgirl.kirara.moe";

import "ActivityDungeonAvatar.proto";
import "RogueDiaryAvatarDisableStatus.proto";

// Name: HAOPJHKKJLK
message RogueDiaryAvatar {
